import UIKit
import RxSwift
import RxCocoa

final class TVWireframe: BaseWireframe {

    // MARK: - Private properties -

    private let storyboard = UIStoryboard(name: "TV", bundle: nil)

    // MARK: - Module setup -

    init() {
        let moduleViewController = storyboard.instantiateViewController(ofType: TVViewController.self)
        super.init(viewController: moduleViewController)

        let interactor = TVInteractor()
        let presenter = TVPresenter(view: moduleViewController, interactor: interactor, wireframe: self)
        moduleViewController.presenter = presenter
    }

}

// MARK: - Extensions -

extension TVWireframe: TVWireframeInterface {
}
